import styles from "./CardList.module.css"
export const CardList = ({task, handleDelete}) => {
  return (
  <li className={task.completed ? "completed" : "notcompleted"} > 
              <span className = {styles.title}>{task.id} <span className ="gap"> - </span> {task.name}  <button onClick={() => handleDelete(task.id)} className="Delete">
                    Delete
                </button>
              </span>
            </li>
            )
}
